// import TechCard from "../TechCard/techCard.component";
// import { techMastered } from "../techs/techMastered.component";

// const TechCardCollection = () => techMastered.map((Tech, i) => <TechCard><Tech key={i}/></TechCard>)


import React, { useEffect, useState } from 'react';

const TechCardCollection = () => {
  const [icons, setIcons] = useState([]);

  useEffect(() => {
    const loadIcons = async () => {
      // Dynamically import all SVG files in the specified directory
      const context = require.context('../assets', false, /\.svg$/);
      const iconComponents = await Promise.all(
        context.keys().map(async (key) => {
          // Import each SVG as a React component
          const IconComponent = (await import(`../assets/${key.slice(2)}`)).ReactComponent;

          return <IconComponent />;
        })
      );

      setIcons(iconComponents);
    };

    loadIcons();
  }, []);

  return (
    <div>
      {
      icons.map((Icon, index) => <div key={index}>{Icon}</div>)
      }
    </div>
  );
};

export default TechCardCollection;



